import React from 'react';

const Word_Carousel = () => {
    return (
        <div class="carousel-word">
            <div class="pre"> </div>
            <div class="change_outer">
                <div class="change_inner">
                    <h1 class="element text-index-welcome-3">Software Engineer</h1>
                    <h1 class="element text-index-welcome-3">Software Enthusiast</h1>
                    <h1 class="element text-index-welcome-3">Control Systems Engineer</h1>
                    <h1 class="element text-index-welcome-3">Front-End Developer</h1>
                </div>
            </div>
        </div>
    )
}

export default Word_Carousel;
